const Meal=props=>{
  fetch(
    'https://api.spoonacular.com/recipes/findByNutrients?minCarbs=10&maxCarbs=50&number=2&apiKey=a9b075e6656c45f587b86cba1c8c3789'
  )
    .then((response) => response.json())
    .then((data) => {
      const info=data[0].title;
    })
    .catch(() => {
      console.log("error");
    });


    return (
        <div>
           <h1>{info}</h1> 
        </div>

    )

}
export default Meal;
